-- CURRENCY

DROP TABLE IF EXISTS currency;

CREATE TABLE currency
(
    id          INTEGER NOT NULL,
    moneda      CHARACTER VARYING,
    tipo_cambio INTEGER,
    CONSTRAINT currency_pkey PRIMARY KEY (id)
);


-- Mnisterios

DROP TABLE IF EXISTS ministerios CASCADE;

CREATE TABLE ministerios (
    id   SERIAL            NOT NULL,
    name CHARACTER VARYING NOT NULL,
    CONSTRAINT ministerios_pkey PRIMARY KEY (id)
);



-- Jerarquia

DROP TABLE IF EXISTS jerarquia_final;

CREATE TABLE jerarquia_final (
    idorganismo   SERIAL                   NOT NULL,
    sub_name      CHARACTER VARYING        NOT NULL,
    sub_name_plot CHARACTER VARYING        NOT NULL,
    company_code  CHARACTER VARYING UNIQUE NOT NULL,
    name          CHARACTER VARYING        NOT NULL,
    idministerio  INTEGER,
    CONSTRAINT jerarquia_final_pkey PRIMARY KEY (idorganismo),
    CONSTRAINT ministerios_id_fkey FOREIGN KEY (idministerio)
    REFERENCES ministerios (id) MATCH SIMPLE
    ON UPDATE NO ACTION ON DELETE CASCADE
);

